import React, { useEffect, useRef, useState } from "react";
import Details from "./DetailsProforma";
import CreateProforma from "./CreateProforma";
import Listes from "./Listes";
import { Popup } from "./Popup";

const Proforma = () => {
  class DetailsProforma {
    rubrique;
    article;
    qtt;
    qualite;
    methode;
    pu_30;
  }

  class Methode {
    id;
    nom;

    constructor(id, nom) {
      this.id = id;
      this.nom = nom;
    }
  }

  class Proforma {
    marge;
    acompte;
    date_livraison;
    lieu_livraison;
    mode_livraison_id;
  }

  const listMethode = [
    new Methode(1, "CMMUP"),
    new Methode(2, "FIFO"),
    new Methode(3, "LIFO"),
  ];

  const [articles, setArticles] = useState([]);
  const [rubriques, setRubriques] = useState([]);
  const [listes, setListes] = useState([]);
  const [mode, setMode] = useState([]);
  const [proforma, setProforma] = useState();

  const marge = useRef();
  const acompte = useRef();
  const date = useRef();
  const lieuLivraison = useRef();
  const rubrique = useRef();
  const article = useRef();
  const qt = useRef();
  const methode = useRef();
  const qualite = useRef();
  const modeLivraison = useRef();

  const [visibility, setVisibility] = useState(false);
  const popupCloseHandler = (e) => {
    setVisibility(e);
  };

  useEffect(() => {
    var content = {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    };

    fetch("http://127.0.0.1:3000/datacreatingProforma", content)
      .then((response) => response.json())
      .then((json) => {
        console.log(json.articles);
        setArticles(json.articles);
        setRubriques(json.rubriques);
        setMode(json.modeLivraison);
      });
  }, []);

  const createProforma = (detailsproforma) => {
    detailsproforma.rubrique = rubrique.current.value;
    detailsproforma.article = article.current.value;
    detailsproforma.pu_30 = 0;
    detailsproforma.qtt = qt.current.value;
    detailsproforma.methode = methode.current.value;
    detailsproforma.qualite = qualite.current.value;

    return detailsproforma;
  };

  const addListes = (proforma) => {
    setListes([...listes, proforma]);
  };

  const manageStock = (detailProforma) => {
    var content = {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
    };
    content.body = JSON.stringify(detailProforma);

    fetch("http://127.0.0.1:3000/manageStock", content)
      .then((response) => response.json())
      .then((json) => {
        if ("error" in json) {
          console.log(json);
          alert(json.error);
        } else {
          detailProforma.pu_30 = json.pu + json.pu * (proforma.marge / 100);
          addListes(detailProforma);
        }
      });
  };

  const handleClick = (event) => {
    event.preventDefault();
    var proforma = new Proforma();
    proforma = createProforma(proforma);
    manageStock(proforma);
  };

  const sendData = () => {
    var content = {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
    };
    content.body = JSON.stringify({
      proforma: {
        acompte: proforma.acompte,
        date_livraison: proforma.date_livraison,
        lieu_livraison: proforma.lieu_livraison,
        mode_livraison_id: proforma.mode_livraison_id,
      },
      details: listes,
    });
    fetch("http://127.0.0.1:3000/createProforma", content)
      .then((response) => response.json())
      .then((json) => {
        if ("error" in json) alert(json.error);
      });
  };

  const handleForm = (event) => {
    event.preventDefault();
    sendData();
  };

  const create = () => {
    const proforma = new Proforma();

    proforma.acompte = acompte.current.value;
    proforma.marge = marge.current.value;
    proforma.date_livraison = date.current.value;
    proforma.lieu_livraison = lieuLivraison.current.value;
    proforma.mode_livraison_id = modeLivraison.current.value;

    setProforma(proforma);
  };

  const handleCreate = (event) => {
    event.preventDefault();
    create();
  };

  return (
    <div>
      <CreateProforma
        marge={marge}
        acompte={acompte}
        mode={mode}
        date={date}
        lieuLivraison={lieuLivraison}
        modeLivraison={modeLivraison}
      />

      <input
        className="btn btn-primary"
        type="button"
        value="Creer"
        onClick={handleCreate}
      />

      <Details
        listMethode={listMethode}
        rubriques={rubriques}
        articles={articles}
        rubrique={rubrique}
        article={article}
        methode={methode}
        qt={qt}
        qualite={qualite}
      />

      <input
        className="btn btn-primary"
        type="button"
        value="Ajouter"
        onClick={handleClick}
      />

      <input
        className="btn btn-primary"
        type="button"
        value="Valider"
        onClick={handleForm}
      />

      <br />
      <Listes
        listMethode={listMethode}
        listes={listes}
        rubriques={rubriques}
        articles={articles}
      />

      <button onClick={(e) => setVisibility(!visibility)}>Toggle Popup</button>

      <Popup
        onClose={popupCloseHandler}
        show={visibility}
        title="Hello Jeetendra"
      >
        <h1>Hello This is Popup Content Area</h1>
        <h2>This is my lorem ipsum text here!</h2>
      </Popup>
    </div>
  );
};

export default Proforma;
